import React from 'react';
import './body.css';
import Feed from './Feed';
import Left_side_bar from './Left_side_bar';

function Body() {
  return (
    <div className='body'>
      <Left_side_bar />
      <Feed />
      {/* Right Sidebar */}
    </div>
  );
}

export default Body;
